        //     widgetFunc: (props) => < Options {...props }
        //     />,
        // },
        {
            widgetName: "quiz",
            widgetFunc: (props) => < Quiz {...props }
            />,
            props: {
                questions: [{
                    question: "How do you identify yourself as?",
                    widgets: [{
                        widgetName: "options",
                        widgetFunc: (props) => < Options {...props }
                        />,
                    }, ],
                    id: 1,
                }, ],
            },

        },
    ],
};

export default config
